import React, { useEffect } from 'react';
import './App.css';
import { useTypedSelector } from './store/index';
import { useAppDispatch } from './store/index';
import { fetchWeatherReport } from './reducers/weatherReportReducer';
import WeatherDisplay from './components/WeatherDisplay';

const App: React.FC = () => {
  const weatherReport = useTypedSelector((state) => state.WeatherReport)
  const dispatch = useAppDispatch()

  useEffect(() => {
    dispatch(fetchWeatherReport('helsinki'))
  },[])

  return (
    <div>
      <WeatherDisplay name={weatherReport.name} weather={weatherReport.weather} main={weatherReport.main} wind={weatherReport.wind} />
    </div>
  )
}

export default App;
